using Mobile.Helpers;
using System;
using System.Collections.Generic;
using System.IO;
using System.Linq;
using System.Text;
using System.Threading.Tasks;
using Xamarin.Forms;

namespace Mobile.Services
{
    public class MockDataStore
    {
        ICollection<Models.Assignment> assignments;

        ICollection<Models.Checkpoint> checkpoints;

        public MockDataStore()
        {
            byte[] bytes = Convert.FromBase64String("");
            ImageSource testImage1 = ImageSource.FromStream(() => new MemoryStream(bytes));

            assignments = new List<Models.Assignment>()
            {
                new Models.Assignment { Id = 1, Title="IAB330 Assignment 1", Description = "This is a short description", Skills = null, DateDue = new DateTime(2020, 12, 25), CoverPhoto = testImage1, CoverColour = null},
                new Models.Assignment { Id = 2, Title="CAB220 Assignment 4", Description = "This is a short description for my CAB220 Assignment", Skills = null, DateDue = new DateTime(2020, 11, 25), CoverPhoto = null, CoverColour = SMColours.Red},
                new Models.Assignment { Id = 3, Title="CAB303 Assignment 2", Description = "Networks go brrrrrr...", Skills = null, DateDue = new DateTime(2020, 11, 25), CoverPhoto = null, CoverColour = SMColours.LightGray},
                new Models.Assignment { Id = 4, Title="CABu67 Assignment 2", Description = "Cars go brrmm", Skills = null, DateDue = new DateTime(2020, 11, 25), CoverPhoto = null, CoverColour = SMColours.LightBlue}
            };

            checkpoints = new List<Models.Checkpoint>()
            {
                new Models.Checkpoint { Id = 1,AssignmentId = 1, Title = "Checkpoint 1", Notes = "Hello i am some notes for checkpoint 1", DueDate= new DateTime(2020, 11, 25)},
                new Models.Checkpoint { Id = 2, AssignmentId = 1, Title = "Checkpoint 2", Notes = "Hello i am some notes for checkpoint 2", DueDate= new DateTime(2020, 12, 25)}
            };
        }

        public async Task<ICollection<Models.Assignment>> GetAllByUserAsync(int userID, bool forceRefresh = false)
        {
            return await Task.FromResult(assignments);
        }

        public async Task<Models.Assignment> GetById(long id)
        {
            foreach (Models.Assignment assignment in assignments)
            {
                if (assignment.Id == id)
                {
                    return await Task.FromResult(assignment);
                }
            }

            return null;
        }

        public async Task<bool> AddAssignmentAsync(Models.Assignment assignment)
        {
            assignments.Add(assignment);

            return await Task.FromResult(true);
        }

        public Task<long> GenerateNewAssignmentID()
        {
            return Task.FromResult(assignments.Last().Id + 1);
        }

        public async Task<ICollection<Models.Checkpoint>> GetAllCheckpointsAsync()
        {
            return await Task.FromResult(checkpoints);
        }

        public async Task<ICollection<Checkpoint>> GetAllCheckpointsByAssignmentIDAsync(long assignmentID)
        {
            List<Checkpoint> filteredCheckpoints = new List<Checkpoint>();

            foreach (Models.Checkpoint checkpoint in checkpoints)
            {
                if (checkpoint.AssignmentId == assignmentID)
                {
                    filteredCheckpoints.Add(checkpoint);
                }
            }

            return await Task.FromResult(filteredCheckpoints);
        }
    }
}
